import React from 'react'

import Game1 from './Game1';
import Game2 from './Game2';
import Game3 from './Game3';
import Game4 from './Game4';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function Home() {
  return (
    <Router>
      <div className="App">
          <nav>
          <Switch>
            <Route path="/Game1" components={<Game1 />} />
            <Route path="/Game2" components={<Game2 />} />
            <Route path="/Game3" components={<Game3 />} />
            <Route path="/Game4" components={<Game4 />} />
          </Switch>
          </nav>
      </div>
    </Router>
  );
}

export default Home;
